-- victoria_marathon2016.sql
-- 
-- An SQL representation of the timing data from the 2016
-- Victoria marathon, as collected from
--
-- http://racedaytiming.ca/results/2016GLFVM42KOverall#.V_WUiEJmgQ0
--
-- B. Bird - 03/04/2017


create table marathon2016(
	placing integer, 
	name varchar(100), 
	division varchar(10), 
	total_seconds integer, 
	runner_id varchar(10) primary key, 
	hometown varchar(100), 
	team varchar(100), 
	split_10km integer, 
	split_halfway integer, 
	split_30km integer, 
	split_40km integer, 
	net_time integer);
	

